import React, { useEffect, useState } from "react";
import styles from "./ContactUs.module.scss";
import svs from "../../../../assets/blogImages/svslogo.jpg";
import teamslogo from "../../../../assets/blogImages/team9logo.jpg";
import bhonchesaraLogo from "../../../../assets/blogImages/bhonchesara.webp";
import "bootstrap/dist/css/bootstrap.min.css";
import ContactUsForm from "../../../forms/ContactUsForm";

const ContactUs = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    message: ""
  });

  const [isFormValid, setIsFormValid] = useState(false);

  // Effect for showing cards with delay
  useEffect(() => {
    const showCards = () => {
      setTimeout(() => {
        document.getElementById("card1").style.opacity = "1";
        document.getElementById("card1").style.transform = "translateY(0)";
      }, 500);

      setTimeout(() => {
        document.getElementById("card2").style.opacity = "1";
        document.getElementById("card2").style.transform = "translateY(0)";
      }, 1000);

      setTimeout(() => {
        document.getElementById("card3").style.opacity = "1";
        document.getElementById("card3").style.transform = "translateY(0)";
      }, 1500);
    };

    showCards();
  }, []);

  // Handle form input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => {
      const newFormData = { ...prev, [name]: value };
      checkFormValidity(newFormData);
      return newFormData;
    });
  };

  // Check if form is valid
  const checkFormValidity = (data) => {
    const { name, email, message } = data;
    if (name && email && message) {
      setIsFormValid(true);
    } else {
      setIsFormValid(false);
    }
  };

  return (
    <>
      <div>
        <div>
          <h1 className={styles.helpSection}>
            How can we help you?
            <button
              className={styles.contactButton}
              data-bs-toggle="modal"
              data-bs-target="#contactModal"
              aria-labelledby="contactModalLabel"
            >
              Contact Us
            </button>
          </h1>
        </div>

        {/* Modal */}
        <div
          className="modal fade"
          id="contactModal"
          tabIndex="-1"
          role="dialog"
          aria-labelledby="contactModalLabel"
          aria-hidden="true"
        >
          <div className="modal-dialog" role="document" style={{ marginTop: "6%" }}>
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title" id="contactModalLabel">Contact Us</h5>
                <button
                  type="button"
                  className="btn-close"
                  data-bs-dismiss="modal"
                  aria-label="Close"
                ></button>
              </div>
              <div className="modal-body">
                <ContactUsForm
                  formData={formData}
                  handleInputChange={handleInputChange}
                />
              </div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  data-bs-dismiss="modal"
                >
                  Close
                </button>
                <button
                  type="button"
                  className="btn btn-primary"
                  disabled={!isFormValid}
                >
                  Send Message
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Section with Cards */}
      <div style={{ backgroundColor: '#f0f1f2' }}>
        <div className="container mt-5">
          <div className="row justify-content-center">
            <div
              className="container text-center d-flex flex-column align-items-center justify-content-center"
              style={{ marginTop: 30 }}
            >
              <h1 className={styles.sectionHeader}>We Are Looking for</h1>
              <span
                className="text-muted px-3 mt-2"
                style={{ fontFamily: "system-ui" }}
              >
                We are happy to assist you in providing comprehensive services...
              </span>
            </div>
            <div className="col-md-4 mb-4 mt-4">
              <div
                className={`d-flex flex-column align-items-center justify-content-center p-4 shadow rounded-lg ${styles.projectCard}`}
                id="card1"
              >
                <h6 className={styles.projectName}>Sri SVS Pearls & Jewellers</h6>
                <img className="img-fluid" src={svs} alt="Sri SVS Pearls & Jewellers" />
              </div>
            </div>
            {/* Repeat for card 2 and 3 */}
          </div>
        </div>

        {/* Location Section */}
        <div>
          <h1 className={styles.locationText}>Location</h1>
          <div className={`container shadow ${styles.locationContainer}`}>
            <div className="row">
              <div className="col-md-6 d-flex justify-content-center align-items-center">
                <img
                  src="https://thumbs.dreamstime.com/b/famous-hyderabad-landmark-charminar-india-world-built-quli-qutb-shah-th-century-128124667.jpg"
                  alt="Charminar"
                  className={styles.locationImg}
                  style={{ width: "70%", height: "70%" }}
                />
              </div>
              <div className="col-md-6 d-flex flex-column justify-content-center align-items-center">
                <h2 style={{ textAlign: "center", marginBottom: "20px", fontFamily: "system-ui" }}>
                  TRISHOKA DIGITAL SERVICES
                </h2>
                <u>
                  <p style={{ textAlign: "center", color: "#B87333", fontFamily: "system-ui" }}>
                    Off. No: 1014, 10th Floor, Prajay Princeton Towers...
                  </p>
                </u>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default ContactUs;
